import React,{useState,useEffect} from 'react'

function Carousel(props) {
  const [articles,setArticles] = useState([]);
  const [no,setNo] = useState(1);
  const [image,setImage] = useState("https://fakestoreapi.com/img/71li-ujtlUL._AC_UX679_.jpg");
  const [title,setTitle] = useState("Solid Gold Petite Micropave ");

  const updateData = async ()=>{
    const url  = `https://fakestoreapi.com/products/${props.category?"category/"+props.category:""}`;
    let data = await fetch(url);
    let parsedData = await data.json();
    setArticles(parsedData);
    setImage(articles[no].image);
    setTitle(articles[no].title);
    console.log(articles[no].description);
  }

const Cprev = () =>{

  if(no==0){
  }else{
setNo(no-1);
console.log(no);
updateData();
  }
}

const Cnext = () => {
  setNo(no+1);
console.log(no);
updateData();
}
let {image1} = props;
  return (
<>
<div id="carouselExampleDark" className="carousel carousel-dark slide">
  <div className="carousel-indicators">
    <button type="button" data-bs-target="#carouselExampleDark" data-bs-slide-to="0" className="active" aria-current="true" aria-label="Slide 1"></button>
    <button type="button" data-bs-target="#carouselExampleDark" data-bs-slide-to="1" aria-label="Slide 2"></button>
    <button type="button" data-bs-target="#carouselExampleDark" data-bs-slide-to="2" aria-label="Slide 3"></button>
  </div>
  <div className="carousel-inner">
    <div className="carousel-item active" data-bs-interval="10000">
      <img src={image} className="d-block w-100 siz" alt="..."/>
      <div className="carousel-caption d-none d-md-block">
        <h5 className='wh'>{title}</h5>
        <p className='wh'>Some representative placeholder content for the first slide.</p>
      </div>
    </div>
    <div className="carousel-item" data-bs-interval="2000">
      <img src={image} className="d-block w-100 siz" alt="..."/>
      <div className="carousel-caption d-none d-md-block">
        <h5 className='wh'>{title}</h5>
        <p className='wh'> Some representative placeholder content for the second slide.</p>
      </div>
      </div>
<div className='container'>
      <div className="carousel-item">
        <img src={image} className="d-block w-100 siz" alt="..."/>
        <div className="carousel-caption d-none d-md-block jsc">
          <h3 className='wh'>{title}</h3>
          <p className='wh'> Some representative placeholder content for the third slide.</p>
        </div>
      </div>
</div>
  </div>
  <button onClick={Cprev} className="carousel-control-prev bl" type="button" data-bs-target="#carouselExampleDark" data-bs-slide="prev">
    <span className="carousel-control-prev-icon" aria-hidden="true"></span>
    <span className="visually-hidden">Previous</span>
  </button>
  <button onClick={Cnext} className="carousel-control-next bl" type="button" data-bs-target="#carouselExampleDark" data-bs-slide="next">
    <span className="carousel-control-next-icon" aria-hidden="true"></span>
    <span className="visually-hidden">Next</span>
  </button>
</div>
</>
  )
}

export default Carousel
